INSERT INTO `blockchain_metadata` (`id`, `blockchain_id`, `language`, `description`, `genesis_block`, `source`, `links`, `tagline`, `created_at`, `updated_at`) VALUES
('avalanche-en', 'avalanche', 'en', 'Avalanche is an open-source platform for launching decentralized applications and enterprise blockchain deployments in one interoperable, highly scalable ecosystem. Avalanche is the first decentralized smart contracts platform built for the scale of global finance, with near-instant transaction finality. Ethereum developers can quickly build on Avalanche as Solidity works out-of-the-box.\r\n\r\nA key difference between Avalanche and other decentralized networks is the consensus protocol. Over time, people have come to a false understanding that blockchains have to be slow and not scalable. The Avalanche protocol employs a novel approach to consensus to achieve its strong safety guarantees, quick finality, and high-throughput without compromising decentralization.', '2020-09-23 09:02:06', 'https://docs.avax.network/', '', 'Create your own public or private blockchains.', '2022-06-27 22:13:21', '2022-07-22 21:21:59'),
('binance-smart-chain-en', 'binance-smart-chain', 'en', 'Binance Smart Chain (BSC) is best described as a blockchain that runs in parallel to the Binance Chain. Unlike Binance Chain, BSC boasts smart contract functionality and compatibility with the Ethereum Virtual Machine (EVM). The design goal here was to leave the high throughput of Binance Chain intact while introducing smart contracts into its ecosystem.', '2020-08-29 03:24:08', 'https://academy.binance.com/en', '', 'Scalability remains one of the most challenging hurdles to blockchain development. And that’s where Binance Smart Chain comes in.', '2022-06-27 22:13:21', '2022-07-22 21:21:59'),
('bitcoint-en', 'bitcoin', 'en', 'The original Bitcoin software by Satoshi Nakamoto was released under the MIT license. Most client software, derived or \"\"from scratch\"\", also use open source licensing.\n\nBitcoin is the first successful implementation of a distributed crypto-currency, described in part in 1998 by Wei Dai on the cypherpunks mailing list. Building upon the notion that money is any object, or any sort of record, accepted as payment for goods and services and repayment of debts in a given country or socio-economic context, Bitcoin is designed around the idea of using cryptography to control the creation and transfer of money, rather than relying on central authorities.\n\nBitcoins have all the desirable properties of a money-like good. They are portable, durable, divisible, recognizable, fungible, scarce and difficult to counterfeit.', '2009-01-03 18:15:00', 'https://en.bitcoin.it/wiki/Main_Page', '', 'Bitcoin is a decentralized digital currency that enables instant payments to anyone, anywhere in the world', '2022-06-27 22:13:21', '2022-07-22 21:22:23'),
('ethereum-en', 'ethereum', 'en', 'Ethereum is a technology that\'s home to digital money, global payments, and applications. The community has built a booming digital economy, bold new ways for creators to earn online, and so much more. It\'s open to everyone, wherever you are in the world – all you need is the internet.', '2015-07-30 15:26:13', 'https://ethereum.org/en/', '', 'Ethereum is a decentralized, open-source blockchain with smart contract functionality.', '2022-06-27 22:13:21', '2022-07-22 21:15:41'),
('fantom-en', 'fantom', 'en', 'Fantom is a high-performance, scalable, customizable, and secure smart-contract platform. Fantom is permissionless, decentralized, and open-source. \n\nFantom’s mainnet deployment, Fantom Oper is built on Fantom’s consensus mechanism, Lachesis[Lachesis]. Fantom is a leaderless, asynchronous, and byzantine fault-tolerant Layer 1 blockchain protocol.\r\n\r\nLachesis enables Fantom to deliver fast transaction speeds, low transaction costs, and deterministic finality. This is achieved while remaining permissionless, decentralized, and open-source.', '2019-12-27 03:56:40', 'https://www.fantom.foundation/', '', 'Fantom is a high-performance, scalable, customizable, and secure smart-contract platform. Fantom is permissionless, decentralized, and open-source. ', '2022-06-27 22:13:21', '2022-07-22 21:21:59'),
('polygon-en', 'polygon', 'en', 'Polygon is a Layer 2 scaling solution that achieves scale by utilizing sidechains for off-chain computation and a decentralized network of Proof-of-Stake (PoS) validators.\r\n\r\nPolygon strives to solve the scalability and usability issues while not compromising on decentralization and leveraging the existing developer community and ecosystem. Polygon is an ​off-/sidechain scaling solution for existing platforms to provide scalability and superior user experience to DApps and user functionalities.\r\n\r\nIt is a scaling solution for public blockchains. Polygon PoS supports all the existing Ethereum tooling along with faster and cheaper transactions.', '2020-05-30 07:47:16', 'https://docs.polygon.technology/', '', 'Polygon PoS is a solution that achieves unprecedented transaction speed and cost savings by utilizing side-chains for transaction processing', '2022-06-27 22:13:21', '2022-07-22 21:21:59');
